import "../src/User.css";
function User({ info = "there is missing info here" }) {
  return (
    <div className="container">
      <div className="card">
        <div className="img"></div>
        <p className="info">{info}</p>
        <button className="Btn">buy me</button>
      </div>
    </div>
  );
}
export default User;
